import React from "react"
import CourseCard from "./CourseCard";


const CourseList = ({courses}) => 

    <div className="container">
        {
            courses.map(course =>
            <div className="row">

            <CourseCard key={course.id} course = {course}/>
            </div>
            )
        }
    </div>


export default CourseList
